/*Table structure for table `problems` */

DROP TABLE IF EXISTS `problems`;

CREATE TABLE `problems` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `created_at` int(10) unsigned DEFAULT NULL,
  `updated_at` int(10) unsigned DEFAULT NULL,
  `resolved_at` int(10) unsigned DEFAULT NULL,
  `user_id` int(10) unsigned NOT NULL,
  `partner_id` int(10) unsigned DEFAULT NULL,
  `street_id` int(10) unsigned NOT NULL,
  `building` varchar(10) DEFAULT NULL,
  `city_id` int(10) unsigned NOT NULL,
  `description` text,
  `has_logo` tinyint(1) DEFAULT '0',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `district_id` int(10) unsigned NOT NULL,
  `longitude` float DEFAULT NULL,
  `latitude` float DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

/*Data for the table `problems` */

insert  into `problems`(`id`,`created_at`,`updated_at`,`resolved_at`,`user_id`,`partner_id`,`street_id`,`building`,`city_id`,`description`,`has_logo`,`status`,`district_id`,`longitude`,`latitude`) values (1,2013,NULL,1970,11,2,1997,'40',2,'Далі потрібно обрати маршрут, який вас влаштовує. Біля типу вагону вказана вартість проїзду у ньому і кількість вільних місць. При натисканні на колонку з типом вагону стає доступною можливість вибору конкретного місця або діапазону місць у тому чи іншому вагоні. Необхідну кількість квитків (не більше 4) та тип (дорослий/дитячий) Ви можете обрати у колонці зліва. У цьому ж пункті буде показано загальну вартість вашого замовлення.',1,0,15,24.0661,49.8362),(4,1365001875,NULL,1970,11,0,364,'2',1,'wergergeqrgeqrgqregergergergerger',0,0,4,30.6133,50.4624);

