ня програм на мові С++ – починаючи від теорії і закінчуючи практичними прикладами. Курс С++ викладають компетентні фахівці, які подають корисну інформацію в доступній формі як для новачків, так і для С-програмістів. В курсі програмування на C++ вивчаються всі основи об\'єктно-орієнтовного програмування. Відвідавши курси С++ у Львові, Ви навчитеся створювати власні типи даних, оперувати вже написаними, працювати з пам\'яттю, писати цикли і умовні вирази, реалізовувати на практиці основні механізми ООП - інкапсуляцію, успадкування і поліморфізм, а також дізнаєтеся що таке процедурне програмування, стандарт ANSI C і багато іншої інформації,','Білик Андрій',1,1),(11,'wwfwef','wfwef@efef.efef','wfwfwefw','509c00741153df3d84d94b670179f3e240e58d62d5aae556f8','2013-04-10',NULL,NULL,0,NULL,'1','0',NULL,NULL,NULL,'fwfweefwe',0,0),(12,'wefwef','wefwef@wefwe.wfw','146814685','7a220fed1032bac894f251cfb72f3a60630ac0500c85bd4c0b','2013-04-10',NULL,NULL,0,NULL,'1','0',NULL,NULL,NULL,'wefwfwe wefwfw',0,0),(13,'test','wefwef@eewf.fe','093779996','62046e88b0319c8289f40b334463c5a7cba92d7a76b34d1763','2013-04-04',0,'',0,'','1','0','',NULL,'Сервіс надає пасажирам можливість здійснювати інтернет-замовлення залізничних квитків на потяги «Укрзалізниці».\nУ результаті успішної оплати Ви отримуєте цифровий код. Після пред\'явлення коду Ви без черги і доплати можете отримати квиток у будь-якій касі «Укрзалізниці». Граничний термін отримання квитків - 15 хвилин до відправлення поїзда. Винятком є поїзди 165, 166, граничний термін отримання квитків на які - 1,5 години до відправлення поїзда.\nКупуй залізничні квитки без черг на Tickets.ua','Пупкін Вася',1,1),(14,'wewe','fwwe@fef.fe','093779996','dfda8e0a5f78f603820a8ec4d8349a755ac5e8d422935a2a3f','2013-04-04',0,'',0,'','1','0','',NULL,'Касаційний суд у справі екс-міністра внутрішніх справ Юрія Луценка перенесений на 10:00 п\'ятниці, 5 квітня.\nТаке рішення оголосив головуючий суддя Валерій Швець у справі по стеженню за водієм колишнього першого з